import {Spring} from 'react-spring';
import {
    Navbar,
    Nav, Button, NavItem, ButtonGroup, Container, Row, Col, Carousel } from 'react-bootstrap';
    import logo from '../backgroundimg/01.jpg';

export default function Component1(){
    const imgDem = {
        width:'100%',
        height:'100%',
        backgroundSize:'cover',
        position:'relative'
      }
      const buttonStyle = {
        textAlign:'center',



      }

      const logoStyle = {
        width:'300px',
        height:'auto',


      }

      const ride = {
        textAlign:'center',
        fontSize:'70px',
        color:'white'

      }
      const h1Edit = {
        fontSize:'70px',
        position:'relative',
        color:'black',
        marginRight:'30px'

      }

      const align = {
        textAlign:'center',
        position: 'relative'
      }

      const slideShow = {
        position: 'absolute',
        width:'100%',
        height:'auto'
      }
      const navBar ={}

      const infoSlide = {
        fontSize: '30px',

      }
    return (
       <div>
          <Container>
            <Row>
              <Col></Col>
              <h1 style={h1Edit}>Welcome</h1>
              <Col></Col>
            </Row>
          </Container>
        <Container>
          <Row>
            <Col></Col>
            <Col>
            <div style={align}>
        <img src={logo} style={logoStyle} />
          </div>
            </Col>
            <Col></Col>
          </Row>
        </Container>
        <div style={align}>
            <h1 style={ride}>Riding For Research</h1>
          </div>
       <div style={buttonStyle}>
          <Button variant="primary">Learn More</Button>
       </div>
       </div>

    )
}
